styles:
.sky-action-button {
  border-top: 1px solid #cdcfd2;
  border-bottom: 1px solid #cdcfd2;
  border-left: 1px solid #cdcfd2;
  border-right: 1px solid #cdcfd2;
  max-width: 236px;
  cursor: pointer;
  display: inline-block;
  padding-top: 20px;
  padding-right: 20px;
  padding-left: 20px;
  padding-bottom: 30px;
  text-align: center;
}

.sky-action-button:hover {
  border-color: #c2c4c6;
}

@media (min-width: 768px) {
  .sky-action-button {
    padding: 30px 20px;
  }
}

@media (max-width: 767px) {
  .sky-action-button-icon-header-container {
    margin-bottom: 20px;
  }
  .sky-action-button {
    max-width: none;
    display: block;
    margin-left: 15px;
    margin-right: 15px;
  }
}

